import React from 'react'

const StackBtn = (props)=> {

    let name = props.name.toLowerCase()

    switch (name) {
        case "node":
            name = 'nodejs'
            break;
        case "golang":
            name = 'go'
            break;
        default:
            break;
    }

    return (
        <i className={`devicon-${name.toLowerCase()}-plain`}></i>
    );
}

export default StackBtn
